//删除比赛
function del_contest(){
    var tr = this.parentNode.parentNode;
    var num = tr.childNodes[0].innerText;
    var competition = contest_list[num-1];
    id = competition.competitionId
    layer.open({
        type: 1,
        offset: 'auto', //具体配置参考：http://www.layui.com/doc/modules/layer.html#offset
        id: 'layerDemo1', //防止重复弹出
        content: '<div style="padding: 20px 50px;">' + "确定删除此场比赛相关精彩瞬间吗？" + '</div>',
        btn: ['确定', '取消'],
        btnAlign: 'c', //按钮居中
        shade: 0.5, //不显示遮罩
        title: "删除比赛",
        btn1 : function () {
            delCompetition(id);
            return false;
        },
        btn2 : function () {
            layer.closeAll();
        }
    });
}
function delCompetition(id){
    $.ajax({
        url : '../../../Highlight/delete',//删除某一场已结束的比赛
        type : 'post',
        data : {"competitionId" : id},
        scriptCharset : 'utf-8',
        success : function (result) {
            if(result.status == "success"){
                layer.open({
                    type: 1,
                    offset: 'auto', //具体配置参考：http://www.layui.com/doc/modules/layer.html#offset
                    id: 'layerDemo2', //防止重复弹出
                    content: '<div style="padding: 20px 100px;">' + "删除成功！" + '</div>',
                    btn: '确定',
                    btnAlign: 'c', //按钮居中
                    shade: 0.5, //不显示遮罩
                    title: "HZNUCTF",
                    yes : function () {
                        window.location.reload();
                    }
                });
            }
            else{
                layer.msg(result.message);
            }
        },
        error : function () {
            layer.msg("删除失败！");
        }
    });
}
